
# -*- coding: utf-8 -*-
import sys
"""
https://leetcode.com/problems/longest-substring-without-repeating-characters/description/


Given a string, find the length of the longest substring without repeating characters.

Example 1:

Input: "abcabcbb"
Output: 3 
Explanation: The answer is "abc", with the length of 3. 

Example 2:

Input: "bbbbb"
Output: 1
Explanation: The answer is "b", with the length of 1.

Example 3:

Input: "pwwkew"
Output: 3
Explanation: The answer is "wke", with the length of 3. 
Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
"""


"""
algo1的思路总是超时，这次换一种思路：
    假设输入字符串s的长为L，先从L长的字符串(也就是s本身)开始，然后是L-1长的字符串，直到找到某个子串里面是
    没有重复元素的，这个字符串的长度就是最长的无重复字符子串长度（因为是从长度最长开始的）。
    此外在判断某个字符串是否没有重复字符时，不再用字符串类型自带的count方法了，该用in。但是最后那个31000个字符
    的用例还是过不去，妈蛋。。。看来必须得用hashmap才行。。。
"""

class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        """<这个是algo1>
        maxSubstrLen = 0
        for i in range(len(s)):
            for j in range(i+1, len(s)+1):
                noRepeatCharacter = True
                for k in range(j-i): 
                    if s[i:j].count(s[i:j][k]) >= 2:
                        noRepeatCharacter = False
                        break
                if noRepeatCharacter:
                    maxSubstrLen = max(maxSubstrLen, len(s[i:j]))
        return maxSubstrLen
        """

        maxSubstrLen = 0
        curlen = len(s)

        while curlen > 0:
            # -- 当前检测的子串长为curlen时，最大的起始下标也只能是 len(s) - curlen。
            #    但是考虑到这个破range函数，所以括号里的内容是 len(s) - curlen + 1。
            #    具体的例子：设len(s)=L
            #    假设子串长为L-1，易得此时需要考虑的子串就两个，s[0]开头到s[L-2]，s[1]开头到s[L-1]。
            #    此时如果是 i in range(len(s)-curlen) 就会变成 i in range(1)，结果i只能取0。
            for i in range(len(s)-curlen+1):
                noRepeatCharacter = True
                # k遍历每个长为curlen的子串的所有可能下标。
                for k in range(i, i + curlen):
                    # 这里也不用string的count方法了，因为感觉用count方法一定会把字符串遍历一遍算出到底有多少个。实际上这里只要判断有重复就行。
                    if s[k] in s[i:k] or s[k] in s[k+1:i+curlen]:
                        noRepeatCharacter = False
                        break
                if noRepeatCharacter:
                    return max(maxSubstrLen, curlen)
            curlen -= 1
        # -- 这里加个return 0可不是因为C语言的惯例，而是因为测试用例为''的话while循环根本不进去，
        #    但是为了效率return语句只在while循环里有！
        #    其实完全可以开头时候先判断下，如果s=''的话直接返回0就好。但是那样写下次看不容易记住这个错。  
        return 0


class Test():
    def run(self, s):
        sol = Solution()
        res = sol.lengthOfLongestSubstring(s)
        print ("The max length of input string %s is %d." % (s, res))

if __name__=="__main__":
    print("------------------------------\nThe main program will start!\n------------------------------\n")
    print("The default coding is:", sys.getdefaultencoding())
    print("\n")

    test = Test()

    # examples/test cases from the problem
    test.run("abcabcbb")
    test.run("bbbbb")
    test.run("pwwkew")

    # self-designed test cases
    test.run('come')
    test.run("a1b")
    test.run("xyz#!")
    test.run('t')
    test.run(" ")
    test.run(" a ")

    # not passed test cases
    test.run('aab')
    test.run('dvdf')
    test.run("gjbbcubrxapxmkveaiombckftocwaifitgjwdnpapezbqwhqhvdizpotdspfcwpxfbtiqikfolieipxpmazmrphxj")
    test.run("otpubyjbulayglneiafxcvsqepewrnpgggcjelmbypbeaqliqqhvlzlsqpqiefqnlsysfntdcwhenuodkvyywlsociwjno")
    test.run(" ")
    test.run("")

